dialogue.27:
Explainer: Why? This is a very good question. So, let's just start with space, right? We know a little bit about space. So here's my simple minded way of drawing space two dimensions, because that's how many I can draw on the blackboard. Let's say X and Y. And what is special about space, there's many things, but one is that if I have a curve or a path between two points, there's a distance that you can calculate, right? And the distance between those two points doesn't depend on your coordinates. It doesn't depend on whether you're in radial coordinates or Cartesian coordinates, or whatever. I'm allowed to imagine a curve that does something like this between those two points, and if I were a person walking on that curve, I would have an odometer with me maybe, and I would know, you would know, even without having done that, this path is always gonna be longer than that path. There's a formula, Pythagoras' Theorem that tells you what the shortest distance path is. That's the point. The physical-ness of what is real is the distance along a certain curve. So spacetime is like that. That's why it is useful to think about spacetime.
Explainee: Okay.
