dialogue.275:
Explainer: The best way to kind of think about that distinction really goes back historically to one of the most important discoveries in memory research. The patient was referred to famously as patient HM. The neurosurgeon went in and removed the tissue that happened to be right around the hippocampus on both the left side and the right side of HM's brain. But then they started noticing something odd in his behavior. He was not able to create new memories of the experiences he had after the surgery. And that led Brenda Milner and her colleagues to report that the hippocampus was very important for memory, but a one particular kind, these sort of explicit, or as now referred to them episodic memories. But the hippocampus was not necessary for learning skills like mirror tracing, things that you can't necessarily articulate but you just get better at over time. And it really led to a couple of decades or more even of an enormous amount of very important work that kind of kept on breaking memory down further and further into different types. Episodic and semantic as both forms of explicit memory where episodic refers to memory for an event that happened like what you did yesterday morning and semantic refers to general knowledge about the world. Implicit memory is being broken down into a bunch of different kinds like skills or habits or conditioning. And when I started graduate school, many of us felt kind of the next question was really to understand how do we now understand how they work together. This was right around when functional magnetic resonance imaging started becoming a popular tool for measuring brain activity. We could scan the entire brain and we could ask questions about multiple brain regions at once. And we discovered that what we might expect during a skill learning task that only the striatum might show activity, that we also saw the activity in the hippocampus. Or when we asked someone to form an episodic memory that we thought might depend only on the hippocampus we suddenly also saw activity in the prefrontal cortex. And so the confluence of these new ideas and questions about how different forms of memory interact together with the development of new tools for studying the human mind and brain allowed us to kind of adjust our view of memory systems, to think of them less as multiple completely separate independent systems and instead to try to understand how they really work in concert with each other and give rise to all kinds of behaviors that might not fit neatly into one category or another.
